import React from 'react';
import { Link } from 'react-router-dom';
import { fetchLogout } from './Fetch';
import { AppBar, Toolbar, Typography, Button, Box } from '@mui/material';

/**
 * Nav component used to show the navigation button
 */
function Nav () {
  /**
   * Function called when the submit button is clicked.
   * Submit the logout info to backend and remove the token
   */
  const toLogout = async () => {
    try {
      const data = await fetchLogout()
      localStorage.clear()
      if (!data) {
        console.log('not logout')
      }
    } catch (e) {
      alert(e)
    }
  }
  return (
    <Box sx={{ flexGrow: 1, backgroundColor: 'rgb(60, 60, 60)', height: '8vh' }}>
      <AppBar position="static" sx={{ backgroundColor: 'transparent', boxShadow: 'none' }}>
        <Toolbar>
          <Typography variant="h6" color="Black" component="div" sx={{ flexGrow: 1, color: 'white' }}>
            PRESTO
          </Typography>
          {location.pathname === '/' && (
            <Link to="/register">
              <Button sx={{ color: 'white' }} >Register</Button>
            </Link>
          )}

          {location.pathname === '/register' && (
            <Link to="/">
              <Button sx={{ color: 'white' }} >Login</Button>
            </Link>
          )}

          {location.pathname === '/login' && (
            <Link to="/" onClick={toLogout}>
              <Button sx={{ color: 'white' }} >Logout</Button>
            </Link>
          )}
        </Toolbar>
      </AppBar>
    </Box>
  )
}

export default Nav
